  false,\n\t\"url\": null,\n\t\"notes\": \"Chemical oceanographic data were collected
  aboard the RYAN CHOUEST in the Gulf of Mexico from 2010-07-28 to 2010-08-09 in response
  to the Deepwater Horizon Oil Spill event on April 20, 2010, by the Subsurface Monitoring
  Unit (SMU), which consisted of multiple government and corporate agencies. These
  data include Total Petroleum Hydrocarbons (TPH) and fluorescence. The instruments
  used to collect these data included fluorometer and gas chromatograph along with
  other physical sampling devices. More specific information about each data set is
  located in their individual metadata records. This data set also contains products
  created for use in real time analysis and decision support. These products may include
  charts, graphs, maps, plots, and GIS formatted data files. Cruise level information
  consisting of data management documents, cruise reports and plans, videos and pictures,
  and other miscellaneous documentation were gathered by the data managers. The Hydrocarbon
  Sensor Array data are raw and provisional. (NODC Accession 0084586)\",\n\t\"license_title\":
